import React from 'react';
import { Link } from 'react-router-dom';
import ProductCard from './ProductCard';

const Products = () => {
  const dummyProducts = [
    { name: 'Product A', price: 100, stock: 5 },
    { name: 'Product B', price: 150, stock: 2 },
    { name: 'Product C', price: 200, stock: 0 },
  ];

  return (
    <div className="p-4">
      <div className="flex justify-between items-center mb-4">
        <h3 className="text-lg font-bold">Product Management</h3>
        <Link 
          to="/seller-dashboard/add-product" 
          className="bg-teal-600 hover:bg-teal-700 text-white font-bold py-2 px-4 rounded"
        >
          Add New Product
        </Link>
      </div>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {dummyProducts.map((product, index) => (
          <ProductCard key={index} name={product.name} price={product.price} stock={product.stock} />
        ))}
      </div>
    </div>
  );
};

export default Products;
